import React, { useState } from 'react';
import { Container, Row, Col, Card, Button } from 'react-bootstrap';
import './Catalog.css';
import img1 from '../../Image/image 3.png';
import img2 from '../../Image/image 3.png';


function Catalog() {
  const [products] = useState([
    { id: 1, image: img1, title: "Горшок", price: "5900 Р" },
    { id: 2, image: img2, title: "Горшок", price: "5900 Р" },
    // Добавьте другие продукты здесь
  ]);

  return (
    <Container>
      <Row className="my-5">
        <Col xs={12}>
          <h2 className="text-center mb-4">Каталог товаров</h2>
        </Col>
        {products.map(product => (
          <Col sm={6} md={4} lg={3} key={product.id} className="mb-4">
            <Card>
              <Card.Img variant="top" src={product.image} />
              <Card.Body>
                <Card.Title>{product.title}</Card.Title>
                <Card.Text>
                  {product.price}
                </Card.Text>
                <Button variant="success">Купить</Button>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>
      <Row>
        <Col className="text-center">
          <Button variant="primary" size="lg">Больше</Button>
        </Col>
      </Row>
    </Container>
  );
}

export default Catalog;
